import React from 'react';
import logo from './logo.svg';
import './App.css';
import './components/CodePenCard.js';
import Button from '@material-ui/core/Button';
import CodePenCard from './components/CodePenCard.js';

const data = {
  height:200,
  width:400,
  title:"KEoLaV",
  penUrl:"//codepen.io/stw/embed/KEoLaV/?height=228&theme-id=0&default-tab=html,result"
}

function App() {
  return (
    <div className="App">
      <header>

      </header>
      <Button variant="contained" color="primary">
      Hello World
    </Button>
    <CodePenCard height={data.height} width={data.width} title={data.title} src={data.penUrl}/>

    </div>
  );
}

export default App;
